import Login from "./Login"
import Register from "./Register"
import { Router } from 'react-router-dom';

function App() {
  return (
    <>
      <Router exact path="/Login" component={<Login/>}/>
      <Router exact path="/Register" component={<Login/>}/>
    </>
  )
}

export default App;
